import React from 'react';
import './Header.css';
import { Link } from 'react-router-dom';
import Navigation from '../Navigation/Navigation';

function Header() {
    return (
        <div className="header">
            <Link to="/" className="header-logo" />

            <Navigation />


        </div>
    )
}

export default Header;
